import React, { Component } from 'react';
import './style.css'

class Toggle extends Component {

    state = {
        checked: this.props.defaultChecked
      }

      static defaultProps = {
        Text: ["Yes", "No"]
      }



    render() {

        return (
            <div className="toggle-switch">
            </div>
        )

    }
}



export default Toggle;
